import Gallary from "./Gallary"
import Product from "./Product"

const allData = {
    gallary: ['A', 'B', 'C', 'D'],
    product: ['E', 'F', 'G', 'H'],
}
const globalContaxt = createContext()

function Main() {
    const [state, dispatch] = useReducer( allData)
    return (
        <div>
            <globalContaxt.Provider value={state}>
                <Gallary />
                <Product />
            </globalContaxt.Provider>

        </div>
    )
}
export default Main
